import React from "react";
import Singup from "../components/Singup";
import Singin from "../components/Singin";

const SingUpScreen = () => {
  return (
    <div className="flex justify-center items-center">
      <Singup />
      <Singin />
    </div>
  );
};

export default SingUpScreen;
